import React from "react";
import MyListItem from "../my-list-item";
import { connect } from "react-redux";

const Table = ({ animes }) => {
    return (
        <table class="table table-dark">
            <thead>
                <tr>
                    <th scope="col">#</th>
                    <th scope="col">Название</th>
                    <th scope="col">Количество Эпизодов</th>
                    <th scope="col">Оценка</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <th scope="row">1</th>
                    <td>Mark</td>
                    <td>Otto</td>
                    <td>@mdo</td>
                </tr>
                <tr>
                    <th scope="row">2</th>
                    <td>Jacob</td>
                    <td>Thornton</td>
                    <td>@fat</td>
                </tr>
                <tr>
                    <th scope="row">3</th>
                    <td colspan="2">Larry the Bird</td>
                    <td>@twitter</td>
                </tr>
            </tbody>
        </table>
    )
}

const MyList = () => {
    return (
        <Table />
    )
}

const mapStatetoProps = ({ myList: { animes } }) => {
    return { animes };
};

export default connect(mapStatetoProps)(MyList);
